style.css:
@-moz-document domain("youtube.com") {
/* เลื่อนเครื่องมือของ YouTube ขึ้น */
.ytp-chrome-bottom,
.ytp-gradient-bottom,
.ytp-progress-bar-container,
.ytp-chrome-controls,
.ytp-chrome-top {
    transform: translateY(-50px) !important;
    bottom: 50px !important;
}

/* เลื่อนวิดีโอขึ้น */
.html5-video-player {
    margin-bottom:40px !important;
}
}
